export default function Footer(props){
    const currentNum = props.comicNum;
    const nums = []

    for(let n = currentNum; n >= currentNum-9; n--){
        nums.push(n)
    }

    return(
        <footer>
            <p>
                {nums.length}
            </p>
        </footer>
    )
}
